import React from "react";

const Home = () => {
  return (
    <div className="w-full min-h-screen flex flex-col justify-center items-center text-center px-4">
      <h1 className="text-6xl md:text-7xl font-bold mb-6 text-white">
        Welcome to <span className="text-purple-400">TrendAI</span>
      </h1>
      <p className="max-w-2xl text-lg md:text-xl text-gray-300">
        Your futuristic gateway to crypto insights, trend analysis, and AI-powered generation tools.
      </p>
    </div>
  );
};

export default Home;
